import React from 'react';

function Body(props) {
    console.log(props.data);
  return (
  <div>{
    props.data.map((val) => <img src={`https://farm${val.farm}.staticflickr.com/${val.server}/${val.id}_${val.secret}.jpg`}/>)
  }
  </div>
  );
}

export default Body;
